import React from 'react'
import {render} from 'react-dom'

function HelloWorld() {
    return (
        <div>
            <h1>test</h1>
            <p>сереня самый лучший челик  мире</p>
        </div>
    )
}

render(<HelloWorld/>, document.getElementById('root'))
